商品名：ＳＵＧＡＯ　ジュレ感リップティント　ジューシーレッド　４．７ｍｌ<br>内容量：1個<br>ブランド：ＳＵＧＡＯ<br>原産国：日本<br><br>ほんわり染まった透け感唇、つづく<br>「スガオ　ジュレ感リップティント　ジューシーレッド」は、まるでジュレのようなみずみずしい塗りごこち。<br>内側からじんわり発色したような、透け感のある唇に。色が落ちにくく、きれいな発色が続きます。<br>ベタつかず、軽い塗りごこち。<br>チップで唇に塗った後、なじませるよう上下の唇をかるくすり合わせます。<br>リップティントが乾いた後、お好きなリップクリームやリップグロスを重ねてもＯＫ。<br>無香料です。<br><br>JANコード:4987241148073<br><br><br>商品番号：101-27271<br><br><br><br>区分: ベースメイク・メイクアップ <br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
